	(14, 'Follow Up Template', 'Follow Up', '<p class="ql-align-center"><em style="color: rgb(0, 0, 0); background-color: transparent;">“We Move, You Smile”</em></p><p class="ql-align-center"><em style="color: rgb(0, 0, 0); background-color: transparent;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</em><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXfTaiZ6nrFA2pWdbIuZmqyktNghoposGHpQyA7wtOkTA_fhte1yAdZjQ4e58CkGMzOTOn974gfToSUOQH0j1ijcTQXy-NCqD4h9Jo-R0ed7EHIkhOpqcQCv7nqlMcnGGAXHQhxB?key=Rgddzg7Mu1Hk2Q77PtGcQV0b" height="65" width="259"></p><p class="ql-align-center"><em style="color: rgb(0, 0, 0); background-color: transparent;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;+1 848-359-8030</em></p><p><br></p><p class="ql-align-center"><em style="color: rgb(0, 0, 0); background-color: transparent;">Licensed &amp; Insured</em></p><p class="ql-align-center">Family Owned Since 2008</p><p class="ql-align-center"><em style="color: rgb(0, 0, 0); background-color: transparent;">Local &amp; Long Distance Moving</em></p><p class="ql-align-center"><em style="color: rgb(0, 0, 0); background-color: transparent;">www.competitiverelocation.com</em></p><p><em style="color: rgb(0, 0, 0); background-color: transparent;">Hi {firstname} {lastname},&nbsp;</em></p><p><br></p><p><em style="color: rgb(0, 0, 0); background-color: transparent;">I hope you\'re doing well! I just wanted to see if you had any updates on our previous message regarding us assisting in furniture and junk removal, local and long distance moving.</em></p><p><em style="color: rgb(0, 0, 0); background-color: transparent;">We’d love the opportunity to work with you and support your clients as they transition into their new homes. Our team is committed to providing reliable, stress-free moves—something we know can make a big difference in your clients’ overall experience.</em></p><p><em style="color: rgb(0, 0, 0); background-color: transparent;">If you’re still considering moving service partners, we’d be happy to:</em></p><ul><li><strong style="background-color: transparent;"><em>Offer priority scheduling for your clients</em></strong></li><li><strong style="background-color: transparent;"><em>Provide customized quotes for each move</em></strong></li><li><strong style="background-color: transparent;"><em>Set up a referral system that benefits both you and your clients</em></strong></li></ul><p><em style="color: rgb(0, 0, 0); background-color: transparent;">Let me know if you\'d be available for a quick call or if there\'s a good time for us to connect this week. We’re excited about the possibility of working together and making your clients’ next move their best one yet!</em></p><p><em style="color: rgb(0, 0, 0); background-color: transparent;">Looking forward to hearing from you.&nbsp;</em></p><p><em style="color: rgb(0, 0, 0); background-color: transparent;">All as well,</em></p><p><em style="color: rgb(0, 0, 0); background-color: transparent;">Love Perry</em></p><p><em style="color: rgb(0, 0, 0); background-color: transparent;">+1 848-359-8030</em></p><p><em style="color: rgb(0, 0, 0); background-color: transparent;">Moving and Delivery Specialist</em></p><p><a href="https://competitiverelocation.com/" rel="noopener noreferrer" target="_blank" style="background-color: transparent; color: rgb(0, 0, 0);"><em>Competitive Relocation Service</em></a></p><p><br></p><p><em style="color: rgb(0, 0, 0); background-color: transparent;">www.competitiverelocation.com</em></p><p><em style="color: rgb(0, 0, 0); background-color: transparent;">13 Galaxy Ct, Sewell, New Jersey 08080</em></p><p><em style="color: rgb(0, 0, 0); background-color: transparent;">DOT #: 1877921</em></p><p><em style="color: rgb(0, 0, 0); background-color: transparent;">MC #: 677599</em></p><p><br></p>', NULL, 'Follow Up Template', '2025-05-03 05:34:31', '2025-05-03 05:34:31'),
	(15, 'Email 1', 'Email 1', '<p class="ql-align-center"><em style="background-color: transparent; color: rgb(0, 0, 0);">“We Move, You Smile”</em></p><p class="ql-align-center"><img src="https://lh7-rt.googleusercontent.com/docsz/AD_4nXfTaiZ6nrFA2pWdbIuZmqyktNghoposGHpQyA7wtOkTA_fhte1yAdZjQ4e58CkGMzOTOn974gfToSUOQH0j1ijcTQXy-NCqD4h9Jo-R0ed7EHIkhOpqcQCv7nqlMcnGGAXHQhxB?key=Rgddzg7Mu1Hk2Q77PtGcQV0b" height="65" width="259"></p><p class="ql-align-center"><em style="background-color: transparent; color: rgb(0, 0, 0);">&nbsp;+1 848-359-8030</em></p><p><br></p><p class="ql-align-center"><em style="background-color: transparent; color: rgb(0, 0, 0);">Licensed &amp; Insured</em></p><p class="ql-align-center"><em style="background-color: transparent; color: rgb(0, 0, 0);">Family Owned Since 2008</em></p><p class="ql-align-center"><em style="background-color: transparent; color: rgb(0, 0, 0);">Local &amp; Long Distance Moving</em></p><p class="ql-align-center"><em style="background-color: transparent; color: rgb(0, 0, 0);">www.competitiverelocation.com</em></p><p><em style="background-color: transparent; color: rgb(0, 0, 0);">Hi {firstname} {lastname},&nbsp;</em></p><p><em style="background-color: transparent; color: rgb(0, 0, 0);">&nbsp;</em></p><p><em style="background-color: transparent; color: rgb(0, 0, 0);">It was a pleasure speaking with you over the phone.</em></p><p><em style="background-color: transparent; color: rgb(0, 0, 0);">&nbsp;</em></p><p><em style="background-color: transparent; color: rgb(0, 0, 0);">I’d like to introduce </em><strong style="background-color: transparent; color: rgb(0, 0, 0);"><em>Competitive Relocation Service</em></strong><em style="background-color: transparent; color: rgb(0, 0, 0);">, your go-to moving company for reliable local&nbsp; and long distance moving and&nbsp; furniture removal companies. Located in Sewell, New Jersey (08080), we are committed to providing seamless and stress-free moving experiences.</em></p><p><em style="backgrou