\n			<p><span style="font-size:11pt"><span style="font-family:Arial,sans-serif"><strong><span style="font-family:&quot;Courier New&quot;"><span style="color:red">Q: Should I tip my movers?</span></span></strong><br />\r\n			<strong><span style="font-family:&quot;Courier New&quot;">A: As in any other service industry, you may wish to thank your moving crew by offering gratuity. There is no set amount for this, but we can suggest you tip based on the satisfaction with your crew; with the general guideline or $5-10 per man per hour. If you feel the crew went above and beyond, you may certainly increase the amount accordingly.</span></strong></span></span><br />\r\n			&nbsp;</p>\r\n\r\n			<p><span style="font-size:11pt"><span style="font-family:Arial,sans-serif"><strong><span style="font-family:&quot;Courier New&quot;"><span style="color:red">Q: Can I ride on the truck on moving day?</span></span></strong><br />\r\n			<strong><span style="font-family:&quot;Courier New&quot;">A: We cannot allow transport of customers for liability reasons</span></strong></span></span></p>\r\n			</td>\r\n			<td style="border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; height:18px; vertical-align:top; width:372px">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing="0" style="border-collapse:collapse; width:744px">\r\n	<tbody>\r\n		<tr>\r\n			<td style="border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:1px solid black; vertical-align:top; width:744px">\r\n			<p style="text-align:center"><span style="font-size:11pt"><span style="font-family:Arial,sans-serif"><a href="http://r20.rs6.net/tn.jsp?f=001GVRKb8RRPJy7HAgZV-PmHGjKnyM2PKTevVdrxMhZqbPolLX3yEeIr2NjILCOV_qbA-AQYt0aTnH9iL7nS16oRxZ7TYVf4qqcXKnLKTaWrFrrFMYR7J-ZYHfWK8eWrJ5YmEph2RKMzdSC51Bw36ObMCT-v8mMN79ZylHESkezoDfIp0Bt1exnOrQp9N4yMv4v17mP4QAJ9DbBXo1Y0ea9fleo-6Ha-oD7pgldkyhBf8jY0BMJ